<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title>Title</title>
    <link href="https://fonts.googleapis.com/icon?family=Material+Icons" rel="stylesheet">
    <link href='https://fonts.googleapis.com/css?family=Roboto:400,700,500' rel='stylesheet' type='text/css'>
    <link href="GoodJSON.css" rel="stylesheet" type="text/css">
</head>
<body>
<div id="GoodJson" class="GJcontainer">
<div id="GJObject" class="GJsection GJgroup">




</div>
</div>

<gjtemplate style="display:none">
    <object>
        <div class="GJcard GJcol GJspan_10">
            <div class="GJcol GJspan_3 GJicon">
                <i class="material-icons GJmi reorder">reorder</i>
                <i class="material-icons GJmi expand" xopen=false>add_circle</i>
                <i class="material-icons GJmi edit" xedit=false>mode_edit</i>
                <i class="material-icons GJmi delete">delete_forever</i>
                <i class="material-icons GJmi more">expand_more</i>
            </div>
            <div class="GJcol GJspan_1 GJtype"></div>
            <div class="GJcol GJspan_2 GJkey"></div>
        </div>
    </object>
    <value>
        <div class="GJcard GJcol GJspan_10">
            <div class="GJcol GJspan_3 GJicon">
                <i class="material-icons GJmi reorder">reorder</i>
                <i class="material-icons GJmi add">note_add</i>
                <i class="material-icons GJmi edit">mode_edit</i>
                <i class="material-icons GJmi delete">delete_forever</i>
                <i class="material-icons GJmi more">expand_more</i>
            </div>
            <div class="GJcol GJspan_1 GJtype"></div>
            <div class="GJcol GJspan_2 GJkey"></div>
            <div class="GJcol GJspan_3 GJvalue"></div>
        </div>
    </value>
    <sub>
    <div class="sub"></div>
    </sub>
</gjtemplate>
<script src="../lib/jquery-1.12.1.js"></script>
<script src="GoodJSON.test.js"></script>
</body>
</html>
